import clsx from "clsx"

const LinkItem = ({ href, icon: Icon, text, badge}) => {
  return (
    <li>
        <a href="{href}" className={clsx(
        "flex items-center p-2 texT-gray-900 rounded-lg", 
        "dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700")}
        >
        <Icon className="mr-2" />
        <span className="flex-1 me-3">{text}</span>
        {badge && <span className={`inline-flex items-center justify-center px-2 `}>{badge.text}</span>}
        </a>
      
    </li>
  )
}

export default LinkItem
